import React from 'react';
import sendIcon from '../img/send.png';

const Chatbox = () => {
  return (
    <div>
      <div >
        <form className="chatbox" >
          <input type="text" placeholder='Type here' />
          <div className="send-icon">
            <img src={sendIcon} alt="Send" />
          </div>
        </form>
      </div>
    </div>
  );
}

export default Chatbox;
